@bradzacher 
yes, it is not supported.
```ts
// received 
import {a,b} from 'foo';
// expected

// received
import a, {b,c} from 'foo';
console.log(a);
// expected
import a from 'foo';
console.log(a)
```
I'm curious about the direction.
I think this case could be implemented with logic that removes multiple unused specifiers at once, rather than deleting each specifier individually. Is this the right approach?
```js
// To express it in pseudocode...
const allNamedSpecifersCount = decl.specifiers.filter(
   s => s.type === AST_NODE_TYPES.ImportSpecifier,
);

if (unusedNamedSpecifiersCount ===  allNamedSpecifiersCount) {

  return fixer.removeRange([
    startBraceToken.range[0],
    endBraceToken.range[1],
   ]);

}
```

- That case wasn't found by [eslint](https://github.com/eslint/eslint/blob/main/tests/lib/rules/no-unused-vars.js) either. It delete specifiers one by one. 
- I'm not sure if it would be a good idea to have fixer affect other variables that it's not currently handling.

Is there another better way? Anyway I'll try implementing it my way and then req for review.
